import React from "react";
import Padang from "./Kota/kotaPadang/Padang";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Padang} />
      </Switch>
    </Router>
  );
}
